import Landing from "./components/Landing";
import Bio from "./components/Bio";

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Header />
        <Landing />
        <Bio />
        <Switch>
        </Switch>
      </div>
    </BrowserRouter>
  );
}

export default App;
